import React from "react";
import "./Footer.css";
import { Link } from "react-router-dom";

function Footer() {
  return (
    <div class="container">
      <div class="row">
        <div className="col align-start">
          <span className="fw-semibold">KHOA - TRUNG TÂM</span>
        </div>
        <div className="col align-start">
          <span className="fw-semibold">CHƯƠNG TRÌNH ĐÀO TẠO</span>
        </div>
        <div className="col align-start">
          <span className="fw-semibold">HỆ THỐNG VÀ TÀI NGUYÊN</span>
        </div>
        <div className="col align-start">
          <div>
            <p>
              <img src="/soict-logo.png" alt="" />
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Footer;
